import { PrismaClient } from '@prisma/client'

const prisma = new PrismaClient()

async function main() {
  const sampleSchools = [
    {
      name: "St. Mary's International School",
      address: '123 Education Street, Sector 15',
      city: 'Mumbai',
      state: 'Maharashtra',
      contact: '9876543210',
      image:
        'data:image/jpeg;base64,',
      email_id: 'info@stmarys.edu'
    },
    {
      name: 'Delhi Public School',
      address: '456 Knowledge Avenue, Block A',
      city: 'Delhi',
      state: 'Delhi',
      contact: '9876543211',
      image:
        'data:image/jpeg;base64,',
      email_id: 'admissions@dps.edu'
    },
    {
      name: 'Kendriya Vidyalaya',
      address: '789 Learning Lane, Government Complex',
      city: 'Bangalore',
      state: 'Karnataka',
      contact: '9876543212',
      image:
        'data:image/jpeg;base64,',
      email_id: 'kv@education.gov.in'
    }
  ]

  try {
    console.log(`Start seeding ...`)

    console.log(`Deleting all schools...`)
    await prisma.school.deleteMany()

    console.log(`Creating sample schools...`)
    for (const school of sampleSchools) {
      await prisma.school.upsert({
        where: {
          email_id: school.email_id
        },
        update: {},
        create: {
          name: school.name,
          address: school.address,
          city: school.city,
          state: school.state,
          contact: school.contact,
          image: school.image,
          email_id: school.email_id
        }
      })
    }

    console.log(`Seeding finished.`)
  } catch (error) {
    console.error('Error during seeding:', error)
    throw error
  }
}

main()
  .catch(e => {
    console.error(e)
    process.exit(1)
  })
  .finally(async () => {
    await prisma.$disconnect()
  })
